pragma solidity 0.8.4;

contract digcert {
    struct Signer{
        string email;
        string first_name;
        string last_name;
        string file_url;
        string hash;
    }
     
    mapping (string => Signer[]) public document;

    function addSigner(string memory _urlOri,string memory _email,string memory _fname,string memory _lname,string memory _url,string memory _hash)public{
        document[_urlOri].push(Signer(_email,_fname,_lname,_url,_hash));
    }

    function countSigner(string memory _urlOri) public view returns (uint){
        return document[_urlOri].length;
    }

}
